                <div className="col-auto"><Link href="/#" className="text-decoration-none">
                  <div className="text-center">
                    <img src={process.env.PUBLIC_URL + "/images/pharmacy.png"} alt='displaying_image' className="img-fluid" style={{ width: "1.5rem" }} />
